        <div>
            Project Info
            {
                (pdetails != null)?
                <div>
                {pdetails.map((item, index) => (
                                        <div className="project_data_teacher">
                                            <div>Project ID: {item._id.$oid}</div>
                                            <div>Project Name: {item.project_name}</div>
                                        </div>
                                    ))}
                </div>:
                <div></div>
            }
            {
                (td != null)?
                <div>
                {td.map((item, index) => (
                                        <div className="project_data_teacher">
                                            <div>Project ID: {item._id.$oid}</div>
                                            <div>Project Name: {item.name}</div>
                                        </div>
                                    ))}
                </div>:
                <div></div>
            }
        </div>
    )
}

export default Project;
